function create() { 
	this.isGame = true;
	this.nextItemL = ['egypt_1.png','guitar_1.png','guitar_1.png'];
	this.nextItemR = ['egypt_0.png','guitar_0.png','guitar_0.png'];
	this.nextReal = ['fake','real'];
	this.nextItemFake = ['samurai_2.png','egypt_2.png','guitar_2.png','guitar_2.png'];
	this.count = 0;
	setScene1();
}

function setScene1(){
	this.bg = game.add.sprite(this.game.world.centerX, this.game.height*0.5,'bg');
	this.bg.anchor.set(0.5);

	this.moneyLeft = game.add.sprite(this.game.width*0.05, this.game.height*0.04,'atlas','money.png');
	this.moneyLeft.anchor.set(0.5);

	this.moneyRight = game.add.sprite(this.game.width*0.95, this.game.height*0.04,'atlas','money.png');
	this.moneyRight.anchor.set(0.5);

	this.textTutorial = game.add.text(this.game.width*0.5, this.game.height*0.04, 'CLICK ON THE REAL ITEM!', this.textDefault);
    this.textTutorial.anchor.set(0.5);
 	this.textTutorial.stroke = '#000000';
    this.textTutorial.strokeThickness = 2;

    this.item1 = game.add.sprite(this.game.width*0.27, this.game.height*0.525,'atlas','samurai_0.png');
	this.item1.anchor.set(0.5);
	this.item1.inputEnabled = true;
	this.item1.realOrFake = 'real';
    this.item1.events.onInputDown.add(tapItem, this);

	this.item2 = game.add.sprite(this.game.width*0.75, this.game.height*0.525,'atlas','samurai_1.png');
	this.item2.anchor.set(0.5);
	this.item2.inputEnabled = true;
	this.item2.realOrFake = 'fake';
    this.item2.events.onInputDown.add(tapItem, this);

    this.signal1 = game.add.sprite(this.game.width*0.27, this.game.height*0.8,'atlas','real.png');
	this.signal1.scale.set(0);
	this.signal1.anchor.set(0.5);
	this.signal1Tween = game.add.tween(this.signal1.scale).to({ x: 1.1, y: 1.1}, 400, Phaser.Easing.Sinusoidal.In).to({ x: 1, y: 1}, 250, Phaser.Easing.Sinusoidal.Out);

	this.signal2 = game.add.sprite(this.game.width*0.76, this.game.height*0.8,'atlas','fake.png');
	this.signal2.scale.set(0);
	this.signal2.anchor.set(0.5);
	this.signal2Tween = game.add.tween(this.signal2.scale).to({ x: 1.1, y: 1.1}, 400, Phaser.Easing.Sinusoidal.In).to({ x: 1, y: 1}, 250, Phaser.Easing.Sinusoidal.Out);
	
	this.signal1Tween.onStart.add(function(){
		this.signal1.alpha = 1;
	});

	this.signal2Tween.onStart.add(function(){
		this.signal2.alpha = 1;
	});

	this.hand = game.add.sprite(this.game.width*0.5, this.game.height*0.62,'atlas','hand.png');
	this.hand.anchor.set(0.5);
	this.hand.angle = 30;
	this.handTween = game.add.tween(this.hand.scale).to({ x: 1.1, y: 1.1}, 600, Phaser.Easing.Sinusoidal.In).to({ x: 1, y: 1}, 600, Phaser.Easing.Sinusoidal.Out).yoyo(true).repeat(-1).start();

    this.bgCTA = game.add.sprite(this.game.world.centerX, this.game.height*-1.5,'bgCTA');
	this.bgCTA.anchor.set(0.5);
	this.bgCTATween = game.add.tween(this.bgCTA).to({y:this.game.height*0.5}, 1200, Phaser.Easing.Sinusoidal.InOut);

	this.bidwars = game.add.sprite(this.game.world.centerX, this.game.height*-1.5,'atlas','bidwars.png');
	this.bidwars.anchor.set(0.5);
	this.bidwarsTween = game.add.tween(this.bidwars).to({y:this.game.height*0.4}, 1200, Phaser.Easing.Sinusoidal.InOut);
	
	this.bgCTA2 = game.add.sprite(this.game.world.centerX, this.game.height*-1.5,'atlas','bgCTA2.png');
	this.bgCTA2.anchor.set(0.5);
	this.bgCTA2Tween = game.add.tween(this.bgCTA2).to({y:this.game.height*0.4}, 1200, Phaser.Easing.Sinusoidal.InOut);
	
	this.apple = game.add.sprite(this.game.width*0.3, this.game.height*-1.5,'atlas','apple.png');
	this.apple.anchor.set(0.5);
	this.appleTween = game.add.tween(this.apple).to({y:this.game.height*0.85}, 1200, Phaser.Easing.Sinusoidal.InOut);
	
	this.android = game.add.sprite(this.game.width*0.7, this.game.height*-1.5,'atlas','android.png');
	this.android.anchor.set(0.5);
	this.androidTween = game.add.tween(this.android).to({y:this.game.height*0.85}, 1200, Phaser.Easing.Sinusoidal.InOut);
	
	this.ctaButton = game.add.sprite(this.game.world.centerX, this.game.height*-1.5,'atlas','playnow.png');
	this.ctaButton.anchor.set(0.5);
	this.ctaButtonTween = game.add.tween(this.ctaButton).to({y:this.game.height*0.7}, 1200, Phaser.Easing.Sinusoidal.InOut);
	this.ctaButtonTween2 = game.add.tween(this.ctaButton.scale).to({x:1.1,y:1.1}, 1000, Phaser.Easing.Sinusoidal.Out).to({x:1,y:1}, 1000, Phaser.Easing.Sinusoidal.In).repeat(-1).yoyo(true);
}

function tapItem(item){
	if(!this.isGame)return;

	this.hand.alpha = 0;
	this.isGame = false;

	this.signal1Tween.start();
	this.signal2Tween.start();

	if(this.item1.realOrFake == 'fake'){
		this.item1.frameName = this.nextItemFake[this.count];
	}

	if(this.item2.realOrFake == 'fake'){
		this.item2.frameName = this.nextItemFake[this.count];
	}

	this.game.time.events.add(1200, function(){
		this.changeItems();
	});	
}

function changeItems(){
	this.signal1.alpha = 0;
	this.signal2.alpha = 0;
	this.signal1.scale.set(0);
	this.signal2.scale.set(0);

	this.item1.frameName = this.nextItemL[this.count];
	this.item2.frameName = this.nextItemR[this.count];

	this.item1.realOrFake = this.nextReal[0];
	this.item2.realOrFake = this.nextReal[1];

	this.signal1.frameName = this.item1.realOrFake + '.png';
	this.signal2.frameName = this.item2.realOrFake + '.png';

	this.count++;
	this.isGame = true;

	if(this.count == 2){
		this.item1.y = this.game.height*0.45;
		this.item2.y = this.game.height*0.45;
		this.signal1.y = this.game.height*0.87;
		this.signal2.y = this.game.height*0.87;
	}

	if(this.count >= 3){
		this.item1.alpha = 0;
		this.item2.alpha = 0;
		this.isGame = false;
		showCTA();
	}
}

function showCTA(){
	this.bgCTATween.start();
	this.bgCTA2Tween.start();
	this.bidwarsTween.start();
	this.ctaButtonTween.start();
	this.appleTween.start();
	this.androidTween.start();
	this.game.input.onDown.add(onClickDownload,this);

	this.game.time.events.add(1200, function(){
		this.ctaButtonTween2.start();
	});
}
